INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("", 0, 1, 0, 91002, 0, 8, 100, 40000, 36, "");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 0, 1, 1, 91002, 107501, 8, 150, 40001, 37, "ぺコリーヌ");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 0, 2, 1, 91002, 107601, 8, 150, 40001, 38, "コッコロ");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 0, 3, 1, 91002, 107801, 8, 150, 40001, 39, "キャル");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 0, 4, 1, 91002, 107701, 8, 150, 40001, 40, "スズメ");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 0, 5, 1, 91002, 107901, 8, 150, 40001, 41, "タマキ");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 0, 6, 2, 91002, 107501, 8, 150, 40001, 42, "ぺコリーヌ");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 0, 7, 2, 91002, 107601, 8, 150, 40001, 43, "コッコロ");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 0, 8, 2, 91002, 107801, 8, 150, 40001, 44, "キャル");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 0, 9, 2, 91002, 107701, 8, 150, 40001, 45, "スズメ");
INSERT INTO `v1_21f11ceacc5caa550a5c038ee2bdd5588c9d701af6097f8ba5770bf031dbc166` VALUES ("夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 0, 10, 2, 91002, 107901, 8, 150, 40001, 46, "タマキ");
